const dict = {
  'c': 3,
  'b': 2,
  'a': 1
};

console.log(dict); // Output: { c: 3, b: 2, a: 1 }

const sortedKeys = Object.keys(dict).sort();
let sortedDict = {};

for (let i = 0; i < sortedKeys.length; i++) {
  sortedDict[sortedKeys[i]] = dict[sortedKeys[i]];
}

console.log(sortedDict); // Output: { a: 1, b: 2, c: 3 }
